import React from 'react';
import {Button} from 'react-bootstrap';
import {FormControl} from 'react-bootstrap';
import {FormGroup} from 'react-bootstrap';
import {Col} from 'react-bootstrap';
import {Form} from 'react-bootstrap';
import {ControlLabel} from 'react-bootstrap';
import {url} from '../url';
import Axios from 'axios';



class AdminLogin extends React.Component{
    constructor(){
        super();
        this.password=React.createRef();
        this.email=React.createRef();
        this.login=this.login.bind(this)
    }
    login(){
      Axios.post(`${url}/admin_login`,{email:this.email.value,password:this.password.value});
    }
    render(){
        return(
            <div style={{margin:"0 2%"}}>
            <div style={{margin:"0 2%"}}><h1>AdminLogin Page</h1></div><br></br>
            <Form horizontal>
  <FormGroup controlId="formHorizontalEmail">
    <Col componentClass={ControlLabel} sm={2}>
      Email
    </Col>
    <Col sm={5}>
      <FormControl name="login" ref={this.email} type="email" placeholder="Email" />
    </Col>
  </FormGroup>

  <FormGroup controlId="formHorizontalPassword">
    <Col componentClass={ControlLabel} sm={2}>
      Password
    </Col>
    <Col sm={5}>
      <FormControl name="password" ref={this.password} type="password" placeholder="Password" />
    </Col>
  </FormGroup>

  <FormGroup>
    <Col smOffset={2} sm={5}>
      <Button onClick={this.login} type="submit">Sign in</Button>
    </Col>
  </FormGroup>
</Form>
</div> 
        )
    }
}
export default AdminLogin;
